import styled from 'styled-components';

export const Div = styled.div`
  display: grid;
  grid-template-columns: 20% 80%;
  grid-template-rows: 100% 100%;
  width: 100%;
  height: 100%;
`;

export const Content = styled.main`
  width: 100%;
  height: 100%;
  display: flex;
  justify-content: center;
  padding: 4rem 100rem;
`;
